import styled from 'styled-components';

const Button = styled.button`
  display: inline-block;
  color: palevioletred;
  font-size: 1em;
  margin: 1em;
  padding: 0.25em 1em;
  border: 2px solid palevioletred;
  border-radius: 3px;
`;

const Input = styled.input`
  padding: 0.5em;
  margin: 0.5em;
  color: palevioletred;
  background: papayawhip;
  border: none;
  border-radius: 3px;
`;

const Wrapper = styled.div`
  display: grid;
  grid-template-columns: 1fr 2fr;
  grid-template-rows: 40px 100px 40px;
  padding-left: 20px;
  color: black;
  display: flex;
  align-items: center;
  font-size: 20px;
`;

const Left = styled.div`
    grid-column: span 4;
`;

const Right = styled.div`
    grid-column: span 8;
`;


export { Button, Input, Left, Right, Wrapper };
